package com.leetcode.test;

import static junit.framework.TestCase.assertEquals;

import org.junit.BeforeClass;
import org.junit.Test;

import com.leetcode.solutions._459;

public class _459Test {
    private static _459.Solution1 solution1;
    private static _459.Solution2 solution2;
    private static _459.Solution3 solution3;

    @BeforeClass
    public static void setup() {
        solution1 = new _459.Solution1();
        solution2 = new _459.Solution2();
        solution3 = new _459.Solution3();
    }

    @Test
    public void test1() {
        assertEquals(true, solution1.repeatedSubstringPattern("abab"));
        assertEquals(true, _459.Solution2.repeatedSubstringPattern("abab"));
        assertEquals(true, _459.Solution3.repeatedSubstringPattern("abab"));
    }

    @Test
    public void test2() {
        assertEquals(false, solution1.repeatedSubstringPattern("aba"));
        assertEquals(false, _459.Solution2.repeatedSubstringPattern("aba"));
        assertEquals(false, _459.Solution3.repeatedSubstringPattern("aba"));
    }

    @Test
    public void test3() {
        assertEquals(false, solution1.repeatedSubstringPattern("a"));
        assertEquals(false, _459.Solution2.repeatedSubstringPattern("a"));
        assertEquals(false, _459.Solution3.repeatedSubstringPattern("a"));
    }

    @Test
    public void test4() {
        assertEquals(false, solution1.repeatedSubstringPattern(
            ""));
        assertEquals(false, _459.Solution2.repeatedSubstringPattern(
            ""));
        assertEquals(false, _459.Solution3.repeatedSubstringPattern(
            ""));
    }

    @Test
    public void test5() {
        assertEquals(true, solution1.repeatedSubstringPattern("ababab"));
        assertEquals(true, _459.Solution2.repeatedSubstringPattern("ababab"));
        assertEquals(true, _459.Solution3.repeatedSubstringPattern("ababab"));
    }

    @Test
    public void test6() {
        assertEquals(false, solution1.repeatedSubstringPattern("abababc"));
        assertEquals(false, _459.Solution2.repeatedSubstringPattern("abababc"));
        assertEquals(false, _459.Solution3.repeatedSubstringPattern("abababc"));
    }

    @Test
    public void test7() {
        assertEquals(false, solution1.repeatedSubstringPattern("abababaaba"));
        assertEquals(false, _459.Solution2.repeatedSubstringPattern("abababaaba"));
        assertEquals(false, _459.Solution3.repeatedSubstringPattern("abababaaba"));
    }
}
